import styled from "@emotion/styled";

const Container = styled.div`
  height: 50rem;
  flex: 1;
  background: salmon;
  > h1 {
    text-align: center;
  }
`;

export const CategoryList = () => {
  return (
    <Container>
      <h1>Catagories</h1>
    </Container>
  );
};
